              <th>Question</th>
              <th>Ans_1</th>
              <th>Ans_2</th>
              <th>Ans_3</th>
              <th>Ans_4</th>
              <th>rightChoise</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {usersArray.map((user) => (
              <tr key={user.Id}>
                <td>
                  <input
                    type="checkbox"
                    onChange={(event) => handleCheckboxChange(event, user)}
                  />
                </td>
                <td>{user.Id}</td>
                <td>{user.Question}</td>
                <td>{user.Ans_1}</td>
                <td>{user.Ans_2}</td>
                <td>{user.Ans_3}</td>
                <td>{user.Ans_4}</td>
